import React, { useState } from 'react';
import { UseMovieList } from '../../hooks/movieprovider'; 
import '../../style/CreateMovie.css';

function CreateMovie() {
    const [movieName, setMovieName] = useState('');
    const [director, setDirector] = useState('');
    const [genre, setGenre] = useState('');
    const [duration, setDuration] = useState('');
    const [releaseDate, setReleaseDate] = useState('');
    const [language, setLanguage] = useState('');
    const [description, setDescription] = useState('');
    const [poster, setPoster] = useState(null);

    const { CreateMovie } = UseMovieList();

    const handleCreateMovie = () => {
        const movieData = {
            movieName,
            director,
            genre,
            duration,
            releaseDate,
            language,
            description,
            poster
        };

        CreateMovie(movieData);
    };

    return (
        <div className='new-movie'>
            <h2>Create Movie</h2>

            <div>
                <label>Movie Name:</label>
                <input type='text' value={movieName} onChange={(e) => setMovieName(e.target.value)} placeholder='Enter movie name' />
            </div>

            <div>
                <label>Director:</label>
                <input type='text' value={director} onChange={(e) => setDirector(e.target.value)} placeholder='Enter director name' />
            </div>

            <div>
                <label>Genre:</label>
                <select value={genre} onChange={(e) => setGenre(e.target.value)}>
                    <option value="">Select Genre</option>
                    <option value="Action">Action</option>
                    <option value="Comedy">Comedy</option>
                    <option value="Drama">Drama</option>
                    <option value="Horror">Horror</option>
                    <option value="Sci-Fi">Sci-Fi</option>
                </select>
            </div>

            <div>
                <label>Duration (in minutes):</label>
                <input type='number' value={duration} onChange={(e) => setDuration(e.target.value)} placeholder='Enter duration' />
            </div>

            <div>
                <label>Release Date:</label>
                <input type='date' value={releaseDate} onChange={(e) => setReleaseDate(e.target.value)} />
            </div>

            <div>
                <label>Language:</label>
                <input type='text' value={language} onChange={(e) => setLanguage(e.target.value)} placeholder='Enter language' />
            </div>

            <div>
                <label>Description:</label>
                <textarea value={description} onChange={(e) => setDescription(e.target.value)} placeholder='Enter movie description'></textarea>
            </div>

            <div>
                <label>Movie Poster:</label>
                <input type='file' accept='image/*' onChange={(e) => setPoster(e.target.files[0])} />
            </div>

            <button className='save-btn' onClick={handleCreateMovie}>Create Movie</button>
        </div>
    );
}

export default CreateMovie;
